import React from "react";
import Input from "../../UI/Input";

import classes from "./MealItemForm.module.css";

const MealsItemForm = () => {
  return (
    <form className={classes.form}>
      <Input type={"number"} id={Math.random()} />
      <button>+ Add</button>
    </form>
  );
};

export default MealsItemForm;
